export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:d,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:d,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:d,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},"8yGiQLsTwG":{data:{id:2150,attributes:{imdbId:"tt0822847",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTQ1MTAwODc3OV5BMl5BanBnXkFtZTcwNzI0MDQ3NA@@._V1_SX300.jpg",type:d,ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"},{Source:"Rotten Tomatoes",Value:"15%"},{Source:"Metacritic",Value:"41\u002F100"}],item_lang:{data:{id:2813,attributes:{title:"Priest",plot:"PRIEST, a post-apocalyptic action thriller, is set in an alternative world -- one ravaged by centuries of war between man and vampires. The story revolves around a legendary Warrior Priest from the last Vampire War who now lives in obscurity among the other downtrodden human inhabitants in walled-in dystopian cities ruled by the Church. When his niece is abducted by a murderous pack of vampires, Priest breaks his sacred vows to venture out on a quest to find her before they turn her into one of them. He is joined on his crusade by his niece's boyfriend, a trigger-fingered young wasteland sheriff, and a former Warrior Priestess who possesses otherworldly fighting skills.",slug:"priest"}}},books:{data:[{id:10613,attributes:{title:"Priest manga volume 8",description:"Everybody wants a piece of Ivan Isaacs. The agents of the fallen angel Temozarela want to destroy him. The law has a bounty on his head, not knowing that no mortal man could hope to take it. The one who needs Ivan most of all is Coburn, a US Marshall who leads a team in an investigation of the recent string of “unusual” incidents around the Southwest. His only lead to finding Ivan is Lizzie, former leader of the Rebel Angels and the only surviving Witness of the St. Baldlas Massacre. Lizzie needs Ivan too—he might be the only one who can help her cure the plague she contracted from her encounter with Temozarela’s agents.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=TK_eDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:b,publisher:c,subtitle:"Pale Rider's Chorus"}},{id:10614,attributes:{title:"Priest manga volume 2",description:"Welcome to St. Baldlas. Population: dwindling. This frontier town is one of the 12 sacred sites that seal the fallen archangel Temozarela in darkness. Now the seal is about to be broken. Demonic preacher Jarbilong has made St. Baldlas his home, and has desecrated the land and poisoned the citizens in preparation for his master's return. The only man who has the power to stop him is Ivan Isaacs, a priest who sold his soul to the devil Belial for the power to fight Temozarela. When Ivan comes to town at High Noon, heads will roll.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=BrDeDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:b,publisher:c,subtitle:"Prelude to the Deceased (Part 2)"}},{id:10615,attributes:{title:"Priest manga volume 13",description:"Eons ago the angel Netraphim was commanded to guard the final gate of heaven; however, this faithful guardian could not prevent Temozarela from proceeding down the path of dissension and war upon man. Now as the bloodiest power struggle ever ignited rides in on the coattails of Ivan Isaacs, will the guardian of Windtale be able to protect this last outpost of outcasts?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=HrDeDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:b,publisher:c,subtitle:""}},{id:10616,attributes:{title:"Priest manga volume 9",description:"Ivan Isaacs, a former priest who now walks outside of God’s grace, walks a bloody path of revenge. When he was alive, he inadvertently freed the traitorous archangel Temozarela from imprisonment. Temozarela is still weak, but his 12 disciples are preparing sanctuary for their lord that will usher in an era of blood and terror. Now Ivan walks the thin line between hope and damnation, seeking out each of the disciples and eventually Temozarela himself. Ivan has already defeated the first minion, but that was like Sunday school compared to his next foe. A former angel driven mad by centuries of exile from providence, Achmode has been creating a twisted mockery of heaven in his domain. Flanked by angels of his own design, Achmode is a fearsome foe indeed...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UK_eDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:b,publisher:c,subtitle:"Halleluiah of the Beast"}},{id:10617,attributes:{title:"Priest manga volume 7",description:"In a forgotten abbey in the American West, a great evil has remained trapped, hidden from human eyes for hundreds of years...until now. A team of Vatican researchers have discovered the Domas Porada, a sarcophagus that holds the spirit of the fallen angel Temozarela. With the help of frontier priest Ivan Isaacs, they have opened it. Big mistake. Freed from centuries of captivity, Temozarela can at long last begin his desecration of God’s Earth, but in his weakened state he needs the help of his unholy apostles. In order to fight back, the dying Ivan must make a pact with the devil Belial for a second chance at life. Ivan only wanted proof of God’s existence—what he got instead was eternal damnation.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Sq_eDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:b,publisher:c,subtitle:"Aria of Lost Souls"}}]}}},meta:{}}},prerenderedAt:1682568401103}}("Min-Woo Hyung","2020-04-23","TOKYOPOP","movie",null,"series",1))